package com.example.auta.domain.entities;import lombok.*;import org.hibernate.annotations.GenericGenerator;import javax.persistence.*;import java.util.*;@Entity@Data@NoArgsConstructor@Builder@AllArgsConstructorpublic class BranchEntity {    @Id    @GeneratedValue(generator = "uuid")    @GenericGenerator(name = "uuid", strategy = "org.hibernate.id.UUIDGenerator")    private UUID id;    private String address;    @Builder.Default    @ToString.Exclude    @OneToMany(mappedBy="branch", orphanRemoval = true)    private Set<EmployeeEntity> employees = new HashSet<>();    @Builder.Default    @ToString.Exclude    @OneToMany(cascade=CascadeType.PERSIST, orphanRemoval = true)    @JoinColumn(name="branch_id")    private Set<CarEntity> cars = new HashSet<>();    @OneToMany(mappedBy = "rentalBranch")    private List<ReservationEntity> rentals;    @OneToMany(mappedBy = "returnBranch")    private List<ReservationEntity> returns;    @ManyToOne @ToString.Exclude    private CompanyEntity company;}